import React from 'react';

const Header = ({ cartCount }) => {
  return (
    <header style={{ padding: '1rem', display: 'flex', justifyContent: 'space-between', alignItems: 'center', borderBottom: '1px solid #eee' }}>
      <h1 style={{ fontSize: '24px' }}>StyleHub</h1>
      <button style={{ backgroundColor: '#3b82f6', color: '#fff', border: 'none', borderRadius: '5px', padding: '0.5rem 1rem' }}>
        Cart ({cartCount})
      </button>
    </header>
  );
};

export default Header;
